import React, {useState} from "react";

export const Route = ({route}) => {
    const [show, setShow] = useState(false);

    const handleClick = () => {
        setShow(!show)
    }
    return <div>
        <h4 key={route.id} onClick={{handleClick}}>{route.name}</h4>
        {show ? <h4>hi</h4>: <></>}
    </div>
};
